import { configureStore, createAsyncThunk, createSlice } from "@reduxjs/toolkit";

export const action = {
    getUser: createAsyncThunk
}

let user = createSlice({
  name: "user",
  initialState: "you-eunkyung",
});

export default configureStore({
  reducer: {
    user: user.reducer,
  },
});
